import React, { Component } from "react";
import { Dropdown, DropdownButton, ButtonGroup, Card } from "react-bootstrap";
import SearchBarwithShowVDS from "./SearchBarwithShowVDS";
import Home from "./Home";
export default class ShowVideos extends Component {
    constructor(props) {
        super(props);
        this.state = {
            ApiRes: this.props
        };
const vdlinkID = this.state.ApiRes.obj[1].id
    }
    render() {
        return (
            <div className="tmShowvideos">
                <SearchBarwithShowVDS />
                <div class='container my-3' align='center'>
                    <Card style={{ width: '60rem' }}>
                        <Card.Body>
                            <div class="embed-responsive embed-responsive-16by9">
                            <iframe width="420" height="315" src="https://www.youtube.com/watch?v=jZ7LFwaggyI" frameborder="0" allowfullscreen></iframe>
                            </div>
                            <div>
                                {/* <button type="button" class="btn btn-outline-success rounded-0">Download</button> */}
                                <div className="mb-2" align='right'>
                                    {['up'].map((direction) => (
                                        <DropdownButton
                                            as={ButtonGroup}
                                            key={direction}
                                            id={`dropdown-button-drop-${direction}`}
                                            drop={direction}
                                            variant="outline-success"
                                            title={` Download`}
                                            className={'rounded-0'}
                                        >
                                            <Dropdown.Header><b>Select Format</b></Dropdown.Header>
                                            <Dropdown.Divider />
                                            <Dropdown.Item href="#/action-1">MP3</Dropdown.Item>
                                            <Dropdown.Item href="#/action-2">MP4</Dropdown.Item>
                                            <Dropdown.Item href="#/action-3">HD</Dropdown.Item>
                                        </DropdownButton>
                                    ))}
                                </div>
                            </div>
                        </Card.Body>
                    </Card>
            </div>

            </div >


        );
    }
}
